import React from 'react';
import PropTypes from 'prop-types';
import FormItem from '../../../../shared/Form/FormItem/FormItem';
import Input from '../../../../shared/Input/Input';
import { Link } from 'react-router-dom';
import { ROUTES } from '../../../../../config/constants';
import Button from '../../../../shared/Button/Button';

const ConnectNotification = props => {
    return (
        <div className='bg-white h-72 p-7 rounded-md shadow-2xl flex flex-col justify-between'>
            <div>
                <p className='text-gray-700 text-xl mb-8'>You have already enabled Telegram notifications</p>
                <div className='flex items-center mb-10'>
                    <span className='font-medium mr-5'>Telegram ID:</span>
                    <span>123456789</span>
                </div>
            </div>

            <div className='flex justify-center'>
                <Link to='#'>
                    <Button type={'primary'} className={'bg-indigo-600 hover:bg-indigo-700'}>
                        Disconnect
                    </Button>
                </Link>
            </div>
        </div>
    );
};

ConnectNotification.propTypes = {};

export default ConnectNotification;
